One night on her rounds, Breanne, a new security guard, spots the big boss getting a blowjob from his assistant. Instead of ignoring the situation and moving on, the new guard is turned on I can't help but watch and play with herself. The boss overhears her and she quickly retreats back to her office. The boss confronts her and &quot;reprimands her&quot; for spying on him. It's nice being the boss sometimes.
